import React from 'react';
import {
  GenerateLinks,
  GenerateRoutes,
} from '../Routings.js';
import {
  SearchLinks,
  SearchRoutes,
} from './Search';

const prefix = "/algorithms";
const algorithms = [];

export function AlgoLinks() {
  return (
    <>
      <h2>Algorithms</h2>
      <ul>
        { dataStructures.map(algo => {
          return (
            <li key={algo.route}>
              <Link to={`/algorithms/${algo.route}`}>
                {algo.name}
              </Link>
            </li>
          )
        })}
      </ul>
    </>
  );
}

export const AlgoRoutes = () => {
  return (
    <GenerateRoutes prefix={prefix} rootPage={AlgoLinks} pages={algorithms}>
      <SearchRoutes/>
    </GenerateRoutes>
  );
}
